(function() {
  var fs, parser, xml2js;

  fs = require('fs');

  xml2js = require('xml2js');

  parser = new xml2js.Parser;

  fs.readFile('canon.xml', function(err, data) {
    console.log(err);
    return parser.parseString(function(err, result) {
      console.log(err);
      return console.dir(result);
    });
  });

}).call(this);
